// src/pages/index.jsx
import { Link } from "react-router-dom";
import { motion } from "framer-motion";
import {
  RiShieldCheckLine,
  RiBankLine,
  RiUserLine,
} from "react-icons/ri";

export default function Landing() {
  return (
    <div className="min-h-screen flex flex-col bg-white text-gray-900">

      {/* ---------------- TOP STRIP ---------------- */}
      <div className="h-2 bg-[#E30B17]"></div>

      {/* ---------------- NAVBAR ---------------- */}
      <header className="w-full py-4 px-10 bg-[#0047B3] text-white flex justify-between items-center shadow-md">
        
        {/* HDFC LOGO BOX */}
        <div className="flex items-center gap-3">
          <div className="flex w-8 h-8 rounded-sm overflow-hidden shadow-md">
            <div className="w-1/2 bg-[#E30B17]"></div>
            <div className="w-1/2 bg-white"></div>
          </div>

          <h1 className="text-2xl font-bold tracking-wide">
            HDFC Digital KYC
          </h1>
        </div>

        {/* NAV LINKS */}
        <nav className="space-x-6 text-sm font-medium">
          <Link to="/" className="hover:text-gray-200">Home</Link>
          <Link to="/login" className="hover:text-gray-200">Login</Link>
          <Link to="/register" className="hover:text-gray-200">Register</Link>
        </nav>
      </header>

      {/* ---------------- HERO SECTION ---------------- */}
      <section className="flex-1 bg-gradient-to-b from-[#0047B3] via-[#0A4ECF] to-[#306BFF] text-white flex flex-col items-center justify-center px-6 py-20">

        <motion.h1
          initial={{ opacity: 0, y: -10 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.7 }}
          className="text-5xl md:text-6xl font-extrabold text-center drop-shadow-lg"
        >
          Seamless Digital KYC Verification
        </motion.h1>

        <motion.p
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.7 }}
          className="text-lg text-blue-100 text-center max-w-2xl mt-4 mb-10"
        >
          Complete your KYC securely, quickly, and 100% online.  
          Designed with HDFC-grade encryption and a premium user experience.
        </motion.p>

        {/* CTA BUTTONS */}
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3 }}
          className="flex space-x-5"
        >
          <Link
            to="/register"
            className="px-10 py-3 bg-white text-[#0047B3] font-semibold rounded-xl shadow-lg hover:bg-gray-100 transition"
          >
            Register
          </Link>

          <Link
            to="/login"
            className="px-10 py-3 bg-[#E30B17] text-white font-semibold rounded-xl shadow-lg hover:bg-red-600 transition"
          >
            Login
          </Link>
        </motion.div>
      </section>

      {/* ---------------- FEATURES SECTION ---------------- */}
      <section className="w-full py-16 bg-white shadow-inner rounded-t-3xl border-t border-gray-200">
        
        <h2 className="text-center text-3xl font-bold text-[#0047B3] mb-12">
          Why Choose HDFC Digital KYC?
        </h2>

        <div className="grid grid-cols-1 sm:grid-cols-3 gap-10 max-w-6xl mx-auto px-6">
          
          <FeatureCard
            icon={<RiShieldCheckLine size={48} className="text-[#0047B3]" />}
            title="Bank-Level Security"
            subtitle="Your documents & personal data are protected with enterprise-grade encryption."
          />

          <FeatureCard
            icon={<RiBankLine size={48} className="text-[#0047B3]" />}
            title="Instant Verification"
            subtitle="Upload your ID and get verification updates in real-time."
          />

          <FeatureCard
            icon={<RiUserLine size={48} className="text-[#0047B3]" />}
            title="Simple & Paperless"
            subtitle="No branch visit required. Complete your KYC digitally in minutes."
          />
        </div>
      </section>

      {/* FOOTER */}
      <footer className="text-center text-sm text-gray-600 py-6">
        © {new Date().getFullYear()} HDFC Bank — Digital KYC System.
      </footer>
    </div>
  );
}

/* ---------------- FEATURE CARD ---------------- */
function FeatureCard({ icon, title, subtitle }) {
  return (
    <motion.div
      whileHover={{ scale: 1.05 }}
      className="p-8 rounded-xl bg-white border border-gray-200 shadow hover:shadow-lg transition text-center cursor-pointer"
    >
      <div className="mb-4">{icon}</div>
      <h3 className="text-xl font-semibold text-[#0047B3] mb-2">{title}</h3>
      <p className="text-gray-600 text-sm leading-relaxed">{subtitle}</p>
    </motion.div>
  );
}
